import * as types from '@store/mutation-types'
import {
  bindActionCreators,
  Dispatch
} from 'redux'

export const setContainerEle = (ele: HTMLElement) => {
  return ((dispatch: Dispatch) => {
    dispatch({
      type: types.SET_CONTAINER_ELE,
      data: ele
    })
  })
}
